import React, { useState } from 'react';
import ResponsiveAppBar from "../components/appbar";
import Container from "@mui/material/Container";
import  Hero  from '../assets/hero.jpg';
import Box from "@mui/material/Box";
import { Grid, Typography } from '@mui/material';
import Promotion_cards from '../components/promotion_cards';
import axios from "axios";

function Anasayfa() {
  const [promotionData, setPromotionData] = useState([]);

  const handleDataFetched = (data) => {
    setPromotionData(data);
  };
return(
 <div>
    <ResponsiveAppBar/>
    <Box sx={{ display: { xs: 'none', md: 'flex' }}}>
     <img style={{ maxWidth: '100%' }} src={Hero} alt="Hero" />
      </Box>
  <Box sx={{ marginTop: '200px' }}> </Box>
  <Box>
    <Typography sx={{maxWidth:"900px",marginX: 'auto',alignItems:'center'}} variant="h1">
      BİZE KATILMAK İSTER MİSİN?
    </Typography>
    <Typography sx={{ marginTop:"20px",maxWidth:"900px",marginX: 'auto',alignItems:'center'}} variant="h6">
      ÜYE OL
    </Typography>
  </Box>
  <Promotion_cards onDataFetched={handleDataFetched} />

  <Box>
  <Box sx={{ marginTop: '200px' }}> </Box>
  </Box>
  </div>

   
);};
export default Anasayfa;
